  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset includes buildings and districts
  in Chicago which are listed on the National Register of Historic Places (NRHP) or
  designated as National Historic Landmarks (NHL).rnrn The NRHP is the official list
  of the Nation's historic places worthy of preservation; NHLs are nationally significant
  historic places designated by the Secretary of the Interior because they possess
  exceptional value or quality in illustrating or interpreting the heritage of the
  United States.rn  rnThe NRHP and NHL programs are federally-established and are
  administered by the National Park Service (www.nps/gov/nr) and the Illinois Historic
  Preservation Agency (IHPA, www.illinoishistory.gov/).  This dataset is provided
  by the City of Chicago based on NRHP and NHL nominations provided by IHPA.rnrn To
  view or use these shapefiles, compression software and special GIS software, such
  as ESRI ArcGIS or QGIS, is required. To download this file, right-click the \"Download\"
  link above and choose \"Save link as.\" Time Period: Data is current as of June
  2012. Update Frequency: Data is updated as needed.\",\n\t\"license_title\": \"License
